const Content = () => {
    const handleClick = (name, e) => {
        console.log("Hello, "+ name + e)
    }
    const name = "Superman";
    return ( 
        <div className="content">
            
            <h2>Blog Content</h2>
            <button className="clickconsolevent" onClick={(e) => handleClick(name,e)}>Click Me!</button>
        </div>
     );
}
 
export default Content
